pragma solidity ^0.5.0;

contract vivo {
  uint public totalRegistered = 0;
  struct Phone {
    uint id;
    string name;
    uint cid;
    uint phone;
    string cust_address;
    string model;
    uint imei_no;
    uint price;
    string purchase_date;
	  string entered_by;
  }

  mapping(uint => Phone) public vivophones;

  constructor() public {
      
  }

  function registerPhone (
    string memory _name,
    uint _cid,
    uint _phone,
    string memory _address,
    string memory _model,
    uint _imei_no,
    uint _price,
    string memory _purchase_date,
	  string memory _entered_by
  ) public {
    totalRegistered++;
    vivophones[totalRegistered] = Phone (
      totalRegistered,
      _name,
      _cid,
      _phone,
      _address,
      _model,
      _imei_no,
      _price,
      _purchase_date,
	    _entered_by
    );
  }

  function updateEntry (
    uint id,
    string memory _name,
    uint _cid,
    uint _phone,
    string memory _address,
    string memory _model,
    uint _imei_no,
    uint _price,
    string memory _purchase_date,
    string memory _entered_by
  ) public {
    vivophones[id] = Phone (
      totalRegistered,
      _name,
      _cid,
      _phone,
      _address,
      _model,
      _imei_no,
      _price,
      _purchase_date,
      _entered_by
    );
  }
}
